/**
 * Socials for the website.
 */
function theme_socials( $social_theme ) {
	if ( $social_theme === 'light' ) {
		$theme = 'light';
	} else {
		$theme = 'dark';
	}
	$socials = [
		'facebook' => [
			'url' => get_field( 'socials_facebook', 'options' ),
			'svg' => '<i class="fa-brands fa-facebook-f"></i>',
		],
		'twitter' => [
			'url' => get_field( 'socials_x', 'options' ),
			'svg' => '<i class="fa-brands fa-x-twitter"></i>',
		],
		'instagram' => [
			'url' => get_field( 'socials_instagram', 'options' ),
			'svg' => '<i class="fa-brands fa-instagram"></i>',
		],
		'linkedin' => [
			'url' => get_field( 'socials_linkedin', 'options' ),
			'svg' => '<i class="fa-brands fa-linkedin-in"></i>',
		],
	];
	$html = '<div class="social-links">';
	foreach ( $socials as $platform => $social_data ):
		if ( $social_data['url'] ):
			$html .= sprintf(
				'<a href="%s" target="_blank" rel="noopener noreferrer" class="btn--icon btn--icon__%s social-link social-link--%s">%s</a>',
				esc_url( $social_data['url'] ),
				esc_html( $theme ),
				esc_attr( $platform ),
				$social_data['svg']
				//ucfirst( $platform )
			);
		endif;
	endforeach;
	$html .= '</div>';
	echo $html;
}

add_action( 'socials', 'theme_socials' );

